class App extends React.Component{
  state = {details: []}

  componentDidMount(){
    let data;
    axios.get('http://localhost:8000/product/v1/products/')
    .then( res =>{
      data = res.data;
      this.setState({
        details : data 
      });
    })
    .catch(err => {})  
  }

  render() {
    return (
      <div> 
        <header>Data generated from Django</header>
        {this.state.details.map((output,id) => (
          <div key = {id}>
          <ul>
          <li>{output.name}</li>
          <li>{output.code}</li>
          </ul>
          </div>
        ))}
      </div>
    )
  }
}

export default App;

